import React, { Component } from "react";
import { jQuery as $ } from "jquery";
import "popper.js";
import "bootstrap/dist/js/bootstrap";
import "bootstrap/dist/css/bootstrap.css";

class Species extends Component {
    render() {
        return (
            <div className="container" style={{ height: "90.75%" }}>
                <div className="row h-100">
                    <div className="col-4 h-100 d-flex flex-column align-content-stretch">
                        <div id="common-name">abc</div>
                        <div
                            className="w-100"
                            style={{ border: "0.5px solid #CCCCCC" }}
                        />
                        <div id="description">abc</div>
                        <div
                            className="w-100"
                            style={{ border: "0.5px solid #CCCCCC" }}
                        />
                        <div id="">abc</div>
                        <div
                            className="w-100"
                            style={{ border: "0.5px solid #CCCCCC" }}
                        />
                        <div id="food">abc</div>
                        <div
                            className="w-100"
                            style={{ border: "0.5px solid #CCCCCC" }}
                        />
                        <div id="habitat">abc</div>
                    </div>
                    <div className="col-8">abc</div>
                </div>
            </div>
        );
    }
}

export default Species;
